import React, { useState } from 'react'

const data = [{
    id:1,
    image:'Earning',
    text:'Total earning',
    num:'$13,690',
    percent:'36%'}    ]


const Ecard = () => {
  return (
    <div>
    {data.map((dataa)=>{
       return(
        <div> 
        <p>{dataa.text}</p>
        <p>{dataa.num}</p>
        </div>
    ) } )}
     </div>
     )}

export default Ecard
